import {Dialog, withStyles} from '@material-ui/core';
import '../../index.css'

const style = {
    dialogPaper: {
        height: '95%',
        width: '60%',
        marginTop: '12%'
    }
}

const Login = ({classes}) => {
    return(
        <Dialog
           open={true}
           classes={{paper: classes.dialogPaper}}
           BackdropProps={{style: {backgroundColor: 'unset'}}}
        >
            <h1 class="App">Autenticação de Usuário</h1>
        </Dialog>
    )
}

export default withStyles(style)(Login);
